import { makeStyles, Theme } from "@material-ui/core/styles";

const useStyles = makeStyles((theme: Theme) => ({
    root: {
        width: "100%",
        height: "100%",
        textAlign: "center",
    },
    btnLogin: {
        width: "100%",
        margin: `${theme.spacing(2)}px 0px`,
    }
}));
export default useStyles;
